func AddDriverIncentiveHistory() {
	file, err := os.Open("/Users/hau.nguyen1/Downloads/data-1699430200818.csv")

	// Checks for the error
	if err != nil {
		log.Fatal("Error while reading the file", err)
	}

	reader := csv.NewReader(file)

	records, err := reader.ReadAll()

	// Checks for the error
	if err != nil {
		fmt.Println("Error reading records")
	}

	query := "INSERT INTO tb_driver_incentive_history (driver_id, campaign_id, date, amount, status, note, point, factor) VALUES "
	// Loop to iterate through
	// and print each of the string slice
	batch := 0
	for idx, record := range records {
		if idx == 0 {
			continue
		}

		driverID, _ := strconv.Atoi(record[0])
		campaignID, _ := strconv.Atoi(record[1])
		amount, _ := strconv.ParseFloat(record[3], 64)
		point, _ := strconv.Atoi(record[9])
		note := record[5]
		if len(note) == 0 {
			note = ""
		}
		query += fmt.Sprintf("(%d, %d, %s, %f, %s, %s, %d, %s),", driverID, campaignID, record[2], amount, record[4], record[5], point, record[10])
		batch++
		if batch >= 1000 {
			//fmt.Println(query)
			err := os.WriteFile("/Users/hau.nguyen1/Downloads/data"+strconv.Itoa(batch)+".txt", []byte(query), 0644)
			if err != nil {
				fmt.Println("write query error: " + err.Error())
			}
			batch = 0
			query = "INSERT INTO tb_driver_incentive_history (driver_id, campaign_id, date, amount, status, note, point, factor) VALUES "
		}
	}
}

